import './App.css';
import { Post } from "./Post";
import { Header } from "./Header";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <>
      <Routes>
        <Route index element={

           <Post />

        } />
        <Route index element={
             <div>Login page</div>

          }>
        </Route>
    </Routes>
    </>
  )
}

export default App;
